from typing import List


def twoSum2(numbers: List[int], target: int) -> List[int]:
    lPtr = 0
    rPtr = len(numbers) - 1

    while lPtr < rPtr:
        if numbers[lPtr] + numbers[rPtr] == target:
            return [lPtr + 1, rPtr + 1]
        elif numbers[lPtr] + numbers[rPtr] > target:
            if numbers[lPtr] > numbers[rPtr]:
                lPtr += 1
            else:
                rPtr -= 1
        elif numbers[lPtr] + numbers[rPtr] < target:
            if numbers[lPtr] < numbers[rPtr]:
                lPtr += 1
            else:
                rPtr -= 1
    return []

